import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Menu = () => {
  const [menuItems, setMenuItems] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Replace {menu-slug} with your actual menu slug
    axios.get('http://localhost/fundedprime/wp-json/menus/v1/menus/header_menu')
      .then(response => {
        setMenuItems(response.data);
        setLoading(false);
      })
      .catch(error => {
        console.error('Error fetching menu:', error);
        setLoading(false);
      });
  }, []);

  if (loading) {
    return <p>Loading menu...</p>;
  }

  return (
    <nav>
      <ul>
        {menuItems.map(item => (
          <li key={item.id}>
            <a href={item.url} className='test'>{item.title}</a>
          </li>
        ))}
      </ul>
    </nav>
  );
};

export default Menu;
